import React from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";

const Map = ({ data }) => {
  const parseLocation = (location) => {
    const match = location.match(/POINT \(([-\d.]+) ([-\d.]+)\)/);
    return match ? [parseFloat(match[2]), parseFloat(match[1])] : null;
  };

  return (
    <MapContainer center={[47.6, -122.3]} zoom={8} style={{ height: "400px" }}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution="&copy; OpenStreetMap contributors"
      />
      {data.map((item, index) => {
        const coords = parseLocation(item["Vehicle Location"]);
        return (
          coords && (
            <Marker key={index} position={coords}>
              <Popup>
                {item.Make} {item.Model} - {item.City}, {item.State}
              </Popup>
            </Marker>
          )
        );
      })}
    </MapContainer>
  );
};

export default Map;
